export class RecipeApp extends Component {
  render() {
    return (
      <div>
        Recipe App coming soon
        <Recipe title="Pasta" />
      </div>
    )
  }
}

export default RecipeApp

class Recipe extends Component{
    render(){
        const {title} = this.props;
        return(
            <div>{this.props.title}</div>
        )
    }
}
